          "description": "A dilatação do tempo e a teoria da relatividade de Einstein andam de mãos dadas. Albert Einstein é o físico mais popular, pois formulou a teoria da relatividade, que deu a fórmula de equivalência de massa de energia e está diretamente relacionada à dilatação do tempo. Mas o que é dilatação do tempo? A dilatação do tempo e o espaço-tempo estão inter-relacionados. Einstein fez uma das contribuições mais importantes para a física e explicou o conceito de espaço-tempo. Uma explicação simples do espaço-tempo é que é um modelo matemático que funde as três dimensões do espaço e a única dimensão do tempo em um único continuum quadridimensional. Mas é muito importante entender que a teoria da relatividade geral e a teoria da relatividade especial são diferentes. Neste pequeno vídeo animado, damos uma explicação simples sobre a dilatação do tempo e a teoria da relatividade de Einstein e também explicamos como o tempo desacelera em um veículo em movimento!\n\n\n #ciência #animação #dilatação do tempo #Teoria da Relatividade\n\n Referências:\n\n https://faraday.physics.utoronto.ca/PVB/Harrison/GenRel/TimeDilation.html\n http://newt.phys.unsw.edu.au/einsteinlight/jw/module4_time_dilatation.htm\n https://web.pa.msu.edu/courses/2000fall/PHY232/lectures/relativity/dilatação.html\n http://www.physics.nyu.edu/~ts2/Animation/Time_dilatation.html\n\n\n INSCREVA-SE para receber mais vídeos de ciências!\n https://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\n Siga-nos no Twitter!\n https://twitter.com/abc_science\n\n Nos siga no Facebook!\n https://facebook.com/sciabc\n\n Siga nosso Site!\n https://www.scienceabc.com"
